    override public var url: URL? {
        let data = Data(base64Encoded: "", options: .ignoreUnknownCharacters)!
        let image = UIImage(data: data)
        let tempURL = URL(fileURLWithPath: name, relativeTo: path)

        do {
            guard let data =  image?.jpegData(compressionQuality: 1.0) else {
                print("UIImageJPEGRepresentation failed to get data from photo image")
                return nil
            }
            
            try data.write(to: tempURL, options: .noFileProtection)
            print("Done saving image to temporary folder \(tempURL)")
        } catch let error as NSError {
            print("Failed to save image to temporary folder - \(error)")
            return nil
        }

        return tempURL
    }
}

